import React from "react";
import CardList from "../components/CardList";
import Nav from "../components/Nav";
import Button from "../components/Button";

class Home extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      data: [
        {
          id: 1,
          title: "Monster",
          description: "drink",
          leftColor: "#42FF0E",
          rightColor: "#000002",
          imgIcono:
            "https://www.monsterenergy.com/media/uploads_image/2020/12/02/auto/400/2cd0b187eb3ea28f5250d12fdb4f0988.png?mod=v1_fdbccdc73cd0c96253e6a1a754324fa3",
        },
        {
          id: 2,
          title: "Red Bull",
          description: "drink",
          leftColor: "#D1260A",
          rightColor: "#1B85F0",
          imgIcono:
            "https://cdn.iconscout.com/icon/free/png-512/redbull-282301.png",
        },
        {
          id: 3,
          title: "Brahma",
          description: "drink",
          leftColor: "#000002",
          rightColor: "#D1260A",
          imgIcono:
            "https://image.winudf.com/v2/image/Yml6LmFwcDRtb2JpbGUuYXBwX2U4YzNmZGMxNTRmMDQyNTE4M2JlZmZkODQ3MTkwZmM2LmFwcF9pY29uX29jZWpsa3My/icon.png?w=170&fakeurl=1",
        },
        {
          id: 4,
          title: "Quilmes",
          description: "drink",
          leftColor: "#EBEDF2",
          rightColor: "#1B85F0",
          imgIcono:
        "https://image.isu.pub/190515194944-1becaf7382dd03decabd664e95ca95b1/jpg/page_1.jpgn"},
      ],
    };
  }

  render() {
    return (
      <div>
        <Nav username="gabriel" />
        <CardList exercice={this.state.data} />
        <Button text="+" url="/home/new"/>
      </div>
    );
  }
}

export default Home;
